pub fn draw_box(graphics: &mut [uefi::protocols::graphics::GraphicsPixel], color: &uefi::protocols::graphics::GraphicsPixel, pix_per_scan: usize, x: usize, y: usize, width: usize, height: usize) {
	let height = height.clamp(0, graphics.len() / pix_per_scan - 1);
	let width = width.clamp(0, pix_per_scan - 1);
	for j in 0..height {
		for i in 0..width {
			let index = (y + j) * pix_per_scan + (x + i);
			graphics[index.clamp(0, graphics.len() - 1)] = *color;
		}
	}
}

pub fn drawcharacter(graphics: &mut [uefi::protocols::graphics::GraphicsPixel], pix_per_scan: usize, charindex: u8, x: usize, y: usize, fontsize: usize, color: &uefi::protocols::graphics::GraphicsPixel) {
	let mut character = FONT[charindex as usize];
	while character != 0 {
		let index = character.leading_zeros();
		let (x_pixel, y_pixel) = ((index % 8) as usize, (index / 8) as usize);
		// for j in 0..fontsize {
		// 	for i in 0..fontsize {
		// 		graphics[(y + j + y_pixel * fontsize) * pix_per_scan + (x + i + x_pixel * fontsize)] = *color;
		// 	}
		// }
		draw_box(graphics, color, pix_per_scan, x + x_pixel * fontsize, y + y_pixel * fontsize, fontsize, fontsize);
		character &= (character.reverse_bits() - 1).reverse_bits();
	}
}
